import React, { Component } from 'react';
import step1 from "../assets/svg/step_1.svg"
import step2 from "../assets/svg/step_2.svg"
import step3 from "../assets/svg/step_3.svg"
import step4 from "../assets/svg/step_4.svg"
import step5 from "../assets/svg/step_5.svg"

interface IProps {
  number: string;
}

class AdvantageItem extends Component<IProps> {
  arr = [step1, step2, step3, step4, step5];
  render() {
    return (
      <div className="step">
        <div className="step-number">1</div>
        <div>{step1}</div>
        <div className="step-text">
          <div className="step-title">Look for apartments & book directly with the supplier</div>
          <div className="step-subtitle">Find with us the best seviced apartment in the city of your choice.
          You can already search on the home-page for date, price and location...</div>
        </div>

        <img className="step-photo" src={step1} alt="" />
      </div>
    )
  }
}

export default AdvantageItem;
